import React from "react";
import { Link } from "react-router-dom";
import {
  Card,
  Box,
  Image,
  Stack,
  Heading,
  Flex,
  Container,
  Columns,
  Text,
  TopNav,
  Paragraph,
  Badge,
} from "bumbag";

import DarkMode from "./DarkMode";
import { MoreHorizontal } from "react-feather";

const NavBar = () => (
  // <Container isFluid paddingX='major-8' paddingY='major-4' position="absolute" align="center">
  // <Columns paddingX='major-8' paddingY='major-4' position="absolute">
    <Flex
      alignItems="center"
      justifyContent="space-between"
    >
      <Columns.Column spread={3} spreadMobile={4}>
        <Link to="/">
          <Heading use="h4">DAVI</Heading>
        </Link>
      </Columns.Column>

      <Columns.Column spread={2} spreadMobile={1} textAlign="center">
        <DarkMode />
      </Columns.Column>

      <Columns.Column spread={1} spreadMobile={1} textAlign="center">
        <button>
          <MoreHorizontal />
        </button>
      </Columns.Column>
    </Flex>
  // </Container>
);

export default NavBar;
